import salads from '../data/salads.json';
import MenuItem from './MenuItem/MenuItem';

export const App = () => {
  return (
    <div>
      <MenuItemList salads={salads} />
    </div>
  );
};

export const MenuItemList = ({ salad }) => {
  return (
    <div>
      {salad.map(salad => (
        <MenuItem
          key={salad.name}
          name={salad.name}
          description={salad.description}
          imageUrl={salad.imageUrl}
          price={salad.price}
        />
      ))}
    </div>
  );
};
